
var nameArray = ["Europa-Bold", "Europa-Light", "Europa-Light", "Europa-Regular", "Europa-Regular", "New Spirit Bold", "New Spirit Light", "New Spirit Medium", "New Spirit", "New Spirit SemiBold"];

var dataArray = ["", "", "", "", "", "", "", "", "", ""];

var fontStretch = ["", "", "", "", "", "", "", "", "", ""];

var fontWeight = ["bold", "300", "300", "normal", "normal", "bold", "300", "500", "normal", "600"];

var fontStyleSubArray0 = ["normal"];

var fontStyleSubArray1 = ["normal"];

var fontStyleSubArray2 = ["italic", "oblique"];

var fontStyleSubArray3 = ["normal"];

var fontStyleSubArray4 = ["italic", "oblique"];

var fontStyleSubArray5 = ["normal"];

var fontStyleSubArray6 = ["normal"];

var fontStyleSubArray7 = ["normal"];

var fontStyleSubArray8 = ["normal"];

var fontStyleSubArray9 = ["normal"];

var fontStyle = [fontStyleSubArray0, fontStyleSubArray1, fontStyleSubArray2, fontStyleSubArray3, fontStyleSubArray4, fontStyleSubArray5, fontStyleSubArray6, fontStyleSubArray7, fontStyleSubArray8, fontStyleSubArray9];

function buildFontRule(fontFamily, fontData, fontStyle, fontWeight, fontStretch)
{
	if(fontStyle)
	{
	returnValue = "@font-face { font-family:\"" + fontFamily + "\"; font-style:" + fontStyle + ";";
	if(fontWeight)
	{
		returnValue += "font-weight:" + fontWeight + ";";
	}
	if(fontStretch)
	{
		returnValue += "font-stretch:" + fontStretch + ";";
	}

	returnValue += "src:url(\"data:font/opentype;base64," + fontData + "\"); }";
	return returnValue;
	}
	else 
	{
	return "";
	}
}
var customeStyles = ""
for (var i in dataArray)
{
for (var j in fontStyle[i])
	{
		customeStyles = customeStyles + "<style>" + buildFontRule(nameArray[i], dataArray[i], fontStyle[i][j], fontWeight[i], fontStretch[i]) + "</style>\n";
				
		document.write("<style>" + buildFontRule(nameArray[i], dataArray[i], fontStyle[i][j], fontWeight[i], fontStretch[i]) + "</style>");
	}
}

